import React from 'react';
import { Header } from 'components';
import { Board } from './';
import Axios from 'axios';

class Home extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            BoardList : []
        };
    }

    _getList() {
        const apiUrl = '../store/modules/member.js';

        Axios.get(apiUrl)
            .then(data => {
                this.setState({
                    BoardList: data.data.BoardList
                });
            })
            .catch(error => {
                console.log(error);
            });
    }

    render(){
        let re = /(login|detail)/;
        let isAuth = re.test(this.props.location.pathname);

        return (
            <div>
               {isAuth ? undefined : <Header />}
               <BoardList />
            </div>
        );
    }
}


export default Home;
